import React from 'react';
import TopNav from '../components/Navbar/TopNav';
import pedro from "../images/1.jpg";
import ShowPlants from '../components/ShowPlants';
import { useState } from 'react';

//import { useNavigate } from 'react-router-dom';

const Profile = () =>{
    //const navigate = useNavigate();
//
    //function profile() {
    //  navigate('/profile');
    //}
    const [filterPlantName, setFilterPlantName] = useState('');
    return(
        <div className='full_div'>
            <TopNav />

            <input
  type="text"
  placeholder="Filter by plant name"
  value={filterPlantName}
  onChange={(e) => setFilterPlantName(e.target.value)}
  style={{ marginBottom: '10px' }}
/>
            <center>
            <div style={{paddingLeft:'100px',marginTop:'50px'}}></div>
                <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '80%' }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%', margin: '0 auto' }}>
                        <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '30%',backgroundColor: 'rgba(107, 142, 35, 0.3)' ,height:'300px'}}>  
                            <img src={pedro} alt="Foto de Pedro" style={{ width: 'auto', height: '90%', objectFit: 'cover' }} />
                        </div>
                        <div style={{marginLeft:'5%' ,border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '60%', height:'300px' }}>   
                            <div><h3 style={{fontFamily: 'Open Sans, sans-serif'}} >Name : José Moura</h3></div>
                            <div><h3 style={{fontFamily: 'Open Sans, sans-serif'}}>Location : Sintra, Portugal</h3></div>
                            <div><h3 style={{fontFamily: 'Open Sans, sans-serif'}}>About : Compro e vendo plantas!</h3></div>
                            <div style={{marginTop: '.-100px'}}>
                                    <h3 style={{ fontFamily: 'Open Sans, sans-serif',display: 'inline-block', marginRight: '10px' }}>Rating:</h3>
                                    <label htmlFor="star-1" style={{ display: 'inline-block' }}>1</label>
                                    <input type="radio" id="star-1" name="rating" value="1" style={{ display: 'inline-block' }} />
                                    <input type="radio" id="star-2" name="rating" value="2" style={{ display: 'inline-block' }} />
                                    <input type="radio" id="star-3" name="rating" value="3" style={{ display: 'inline-block' }} />
                                    <input type="radio" id="star-4" name="rating" value="4" style={{ display: 'inline-block' }} />
                                    <input type="radio" id="star-5" name="rating" value="5" style={{ display: 'inline-block' }} />
                                    <label htmlFor="star-5" style={{ display: 'inline-block' }}>5</label>
                                </div>
                           </div>
                           <div><button style={{  width:'70%',backgroundColor: '#ff0000', color: 'white', padding: '5px 20px', fontSize: '20px', borderRadius: '5px', border: 'none', cursor: 'pointer' }}>LogOut</button>
                            <button style={{ width:'70%',backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '20px', borderRadius: '5px', border: 'none', cursor: 'pointer',marginTop:'10px' }}>Add plant to sell</button></div>

                    </div>
                    <div style={{ marginTop:'10px',fontFamily: 'Open Sans, sans-serif'}}><h2>Your plants for sale:</h2>
                    <ShowPlants filterPlantName={filterPlantName} filterVendorName="João Moura"/>

                    </div>
                    <div style={{ marginTop:'10px',fontFamily: 'Open Sans, sans-serif'}}><h2>Your last purchases:</h2>

                    </div>
                </div>
            </center>
            </div>

    );
}

export default Profile;
